import React from 'react';

const UserProfile = ({userInfo}) => {
    const date = new Date();
    const hour = date.getHours();
    // console.log(userInfo.images[0].url)
    return (
        <>
        {/* <pre>{JSON.stringify(userInfo)}</pre> */}
        {userInfo ? 
        <div className="userprofile">
            <img className="profilepic" src={userInfo.images[0].url} alt="profile pic"/>
            {hour>=12 ? hour>=16 ? <h2>Good Evening, {userInfo.display_name}</h2> : <h2>Good Afternoon, {userInfo.display_name}</h2> : <h2>Good Morning {userInfo.display_name}</h2>}

            <h1>{userInfo.display_name}</h1>
            <div>{userInfo.country}</div>
            <div>Followers: {userInfo.followers.total}</div>
        </div> : ''}
        </>
    );
};

export default UserProfile;
